// CHALLENGE 7
// 7) Write a function that uses a while loop to print the numbers 1 through 10.
// The increment operator ( ++ ) increments (adds one to) its operand and returns a value.

function whilePrint(){
    let num = 0;
    while (num < 10){
        num++;
        console.log(num);
    }
}

whilePrint();
